def RNA_to_Protein(rna):
    protein = ""
    for indx in range(0, len(rna), 3):
        codon = ""
        try:
            for i in range(indx, indx + 3):
                codon += rna[i]
        except IndexError:
            continue
        print(codon)
        if CODON_TABLE[codon] != "Stop":
            protein += CODON_TABLE[codon]
    return protein

